document.addEventListener("DOMContentLoaded", function() {
  var htmlElement = document.documentElement;
  htmlElement.removeAttribute("data-theme");
  htmlElement.removeAttribute("data-assets-path");
  htmlElement.removeAttribute("data-base-url");
  htmlElement.removeAttribute("data-framework");
  htmlElement.removeAttribute("data-template");
  htmlElement.removeAttribute("data-style");
});
